class Solution:
	# @param tokens, a list of string
	# @return an integer
	def evalRPN(self, tokens):
		l = []
		for token in tokens:
			if token == '+':
				l.append(l.pop() + l.pop())
			elif token == '-':
				op2 = l.pop()
				op1 = l.pop()
				l.append(op1 - op2);
			elif token == '*':
				l.append(l.pop() * l.pop())
			elif token == '/':
				op2 = l.pop()
				op1 = l.pop()
				if op1 * op2 < 0:
					l.append(-(-op1 / op2))
				else:
					l.append(op1 / op2)
			else:
				l.append(int(token))
		return l.pop()

